import React from "react";

export default function Home() {
  return (
    <section className="page home-page">
      <h1>الرئيسية</h1>
      <p>
        مرحبًا بك في منصة أصداء. اختر من القائمة الجانبية للوصول إلى باقي
        الأقسام.
      </p>
    </section>
  );
}
